import React from "react";
import axios from "axios";
import {useSelector} from "react-redux";
import history from '../../history';

const StructureRiderDeliveries = (props) => {


    return (
        <tr >
           <td > 
                {props.id}
            </td>
            <td>
                {props.user}
            </td>
            <td>
                {props.pickupitem} 
            </td>
            <td>
                {props.pickupaddress}  
            </td>
            <td>
                {props.name}
            </td>
            <td>
                {props.phone}
            </td>
            <td>
                {props.email}
            </td>
            <td>
                {props.pickupdate}
            </td>
            <td>
               {props.amountInNaira} 
            </td>
            <td>
               {props.weightinkg} 
            </td>
            <td>
                {props.pickupquantity}
            </td>
            <td> 
                {props.deliveryaddress}
            </td>
            <td>
                {props.deliveryname}
            </td>
            <td>
                {props.deliveryphonenumber}
            </td>
            <td>
                {props.deliveryemail}
            </td>
            <td>
                {props.status}
            </td> 
            <td>
                {props.deliverydetails}
            </td> 
            <td onClick={SetDelivered}>
                Set order details as Delivered
            </td> 
            <td onClick={SetPartial}>
                Set order details as Partial Delivery
            </td> 
            <td onClick={SetRescheduled}>
                Set order details as Rescheduled
            </td> 
            <td onClick={SetCancelled}>
                Set order details as Cancelled
            </td> 
            <td onClick={SetRejected}>
                Set order details as Rejected
            </td> 
        </tr>
    );

}

export default StructureRiderDeliveries;
